'use strict';

/**
 * Users controller for user profile relation operations.
 */

var route = require('koa-route'),
    parse = require('co-body'),
    mongo = require('../config/mongo');

// register koa routes
exports.init = function (app) {
  app.use(route.post('/api/users', createUser));
  app.use(route.put('/api/users', updateUser));
};

/**
 * Creates a new user.
 */
function *createUser() {

    console.log(this.user);
  if(this.user.role != 'admin') {
      this.status = 403;
      this.body = {error: 'Unauthorized'};
      return;
  }

  // we need to validate user body with node-validator here not to save junk data in the database..
  var user = yield parse(this);

  // get the latest userId+1 as the new user id
  // this is exceptional to user creation as we want user ids to be sequential numbers and not standard mongo guids
  user._id = yield mongo.getNextSequence('userId');
  user.picture = '';
  var results = yield mongo.users.insert(user);

  this.status = 201;
  this.body = {id: results[0]._id};
}

/**
 * Updates a user
 */
function *updateUser() {
    var putData = yield parse(this);

    //console.log(putData);
    var user = mongo.users.find();
    var updateData = {};

    if(typeof putData.user.name != 'undefined') {
        updateData.name = putData.user.name;
        user.name = putData.user.name;
    }
    if(typeof putData.user.password != 'undefined') {
        updateData.password = putData.user.password;
        user.password = putData.user.password;
    }
    if(typeof putData.user.picture != 'undefined') {
        updateData.picture = putData.user.picture;
        user.picture = putData.user.picture;
    }

    var result = yield mongo.users.update(
        {_id: putData.user.id},
        {$set: updateData}
    );

    this.status = 201;
}